    false,nt"url": null,nt"notes": "This Comprehensive Management Plan (CMP)
    for Cypress Creek National Wildlife Refuge (NWR) was prepared to guide management
    direction of the Refuge over the next 15 years. The plan outlines the planning process,
    a description of resources, Refuge goals and objectives, the public use program,
    and plan implementation. Planning issues include habitat loss and fragmentation,
    habitat restoration, watershed issues, coordination of activities and projects,
    adequate staff and funding, local citizen support, and compatible public use.",nt"license_title":
